function add (a,b){
let sum = a+b;
return sum;
}

function subs(a,b){
let sub = a-b;
return sub;
}

function multiply(a,b){
    let multiply = a*b;
    return multiply;
}

function Calc(){
    return(
        <>
        <h1>Addition of  Number is {add(2,5)}</h1>
        <h1>Subsctration of number is  {subs(5,2)}</h1>
        <h1>Multiply of number is  {multiply(5,5)}</h1>
        </>
    );

}

export default Calc;
